using NUnit.Framework;
using System.Threading.Tasks;

namespace InfoCards.PL.APIClient.Tests
{
    [TestFixture]
    public class ApiClientTests
    {
        [Test]
        public async Task GetAllInfoCardsAsync_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var apiClient = new ApiClient();

            // Act
            var result = await apiClient.GetAllInfoCardsAsync();

            // Assert
            Assert.NotNull(result[0]);
        }

        [Test]
        public async Task GetInfoCardByIdAsync_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var apiClient = new ApiClient();

            // Act
            var result = await apiClient.GetInfoCardByIdAsync(1);

            // Assert
            Assert.True(result.Id == 1);
        }

        [Test]
        public async Task CreateInfoCardAsync_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var apiClient = new ApiClient();
            var infoCardModel = new InfoCardModel
            {
                Id = 199,
                Name = "testName",
                ImageBase64 = ""
            };

            // Act
            var result = await apiClient.CreateInfoCardAsync(infoCardModel);

            // Assert
            Assert.True(result.Id == 199);
            await apiClient.DeleteInfoCardByIdAsync(199);
        }

        [Test]
        public async Task UpdateInfoCardByIdAsync_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var apiClient = new ApiClient();
            var infoCardModel = new InfoCardModel
            {
                Id = 299,
                Name = "testName",
                ImageBase64 = ""
            };

            var newInfoCardModel = new InfoCardModel
            {
                Id = 399,
                Name = "newTestName",
                ImageBase64 = ""
            };

            // Act
            await apiClient.CreateInfoCardAsync(infoCardModel);
            var result = await apiClient.UpdateInfoCardByIdAsync(299, newInfoCardModel);

            // Assert
            Assert.True(result.Name == "newTestName");
            await apiClient.DeleteInfoCardByIdAsync(299);
        }

        [Test]
        public async Task DeleteInfoCardByIdAsync_StateUnderTest_ExpectedBehavior()
        {
            // Arrange
            var apiClient = new ApiClient();
            var infoCardModel = new InfoCardModel
            {
                Id = 399,
                Name = "testName",
                ImageBase64 = ""
            };

            // Act
            await apiClient.CreateInfoCardAsync(infoCardModel);
            var result = await apiClient.DeleteInfoCardByIdAsync(399);

            // Assert
            Assert.True(result.Id == 399);
        }
    }
}